import React from 'react';
import './Logout.css';

export const Logout = () => {

    const supabase = createClient(
        process.env.REACT_APP_SUPABASE_URL,
        process.env.REACT_APP_ANON_KEY
      )

    return (
        <div className='logout'>
            <button onClick={() => supabase.auth.signOut()}>Sign Out</button>   

        </div>
    );
}
